import React from "react";
import Weather from "./Weather";
import Homepage from "./Homepage";
import SignIn from "./SignIn";
import Contact from "./Contact";
import YourTour from "./YourTour";
import { useState } from "react";
import Hamburger from "./Hamburger";

const NavBar = () => {
	const [hamburgerOpen, setHamburgerOpen] = useState(false);

	const toggleHamburger = () => {
		setHamburgerOpen(!hamburgerOpen);
	};

	const [page, setPage] = useState(0);

	return (
		<>
			<div className="navigation">
				<ul>
					{page === 0 && <li onClick={() => setPage(1)}>Sign In</li>}

					{page > 1 && <li onClick={() => setPage(2)}>Homepage</li>}

					{page > 1 && <li onClick={() => setPage(3)}>Weather</li>}

					{page > 1 && <li onClick={() => setPage(4)}>Your Tour</li>}

					{page > 1 && <li onClick={() => setPage(5)}>Contact</li>}
				</ul>

				<div className="hamburger" onClick={toggleHamburger}>
					<Hamburger isOpen={hamburgerOpen} />
				</div>
				<style jsx>{`
					.navigation {
						width: 100%
						height: 50px;
						background-color: blue;
					}

					.navigation ul {
						display:flex;
						flex-wrap: wrap;
						float: right;
						margin: 20px 0px;
						padding: 0px 25px;

					}
					.navigation ul li{
						list-style-type: none;
						padding-right: 10px;
					}


						navigation ul
						display: ${hamburgerOpen ? "inline" : "none"};
						background-color: blue;
						height: 100vh;
						width: 50vw;
						margin-top: 50px;
						position: fixed;
						}
					@media (max-width: 800px) {
						.hamburger {
							display: fixed;
							padding-top: 10px;
							margin-left: 10px;
							z-index: 6;
						}

				`}</style>
			</div>
			{page === 1 && <SignIn setPage={setPage} />}
			{page === 2 && <Homepage />}
			{page === 3 && <Weather />}
			{page === 4 && <YourTour />}
			{page === 5 && <Contact />}
		</>
	);
};

export default NavBar;
